import React, { Component } from "react";
import "./estilos.css";
import 'bootstrap/dist/css/bootstrap.min.css';

class Placar extends Component{
   constructor(props){
       super(props)
   }

   render(){
       return(
           <section className='conteudoPlacar'>
           <div className='placarMandante'>
               <h3>Mandante</h3>
               <p className='numeroPlacar'>{this.props.placar.mandante}</p>

           </div>
           <div className='placarVisitante'>
               <h3>Visitante</h3>
               <p className='numeroPlacar'>{this.props.placar.visitante}</p>

           </div>
           </section>

       )
   }

}

export default Placar;
